import React from 'react';
import { View, Text, Image, StyleSheet } from 'react-native';
import { packageContact } from '../../utils/HomeData'
const PackageContact = ({ heading }) => {
    return (
        <View>
            <Text style={styles.contactHeading}>{heading}</Text>
            <View style={styles.c_Box}>
                {packageContact.map((data) => (
                    <View style={styles.c_flex}>
                        <View style={styles.flex_one}>
                            <Image source={data.icon} style={styles.c_img} />
                            <Text style={styles.conNames}>{data.conName}</Text>
                        </View>
                        <View style={styles.flex_two}>
                            <Text>{data.conNum}</Text>
                        </View>
                    </View>
                ))}
            </View>
        </View>
    );
}

const styles = StyleSheet.create({
    contactHeading: {
        padding: '15px',
        color: "#102C56",
        fontWeight: '600',
        fontSize: '18px',
        lineHeight: "24px",
        letterSpacing: '2%'
    },
    c_Box: {
        height: '100px',
        width: '100vw',
        borderBottom: '1px solid #979797',
    },
    c_flex: {
        width: '98vw',
        height: '50px',
        margin: 'auto',
        flexDirection: 'row',
        justifyContent: 'space-between',
        alignItems: 'center'
    },
    flex_one: {
        width: '45vw',
        height: '30px',
        margin: '4px',
        flexDirection: 'row',
        justifyContent: 'space-around',
        ali
    },
    c_img: {
        width: '28px',
        height: '28px',
        borderRadius: '5px',
        color: "#175C4C",
    },
    conNames: {
        color: "#175C4C",
        fontSize: '14px',
        lineHeight: "24px",
        letterSpacing: "2%",
        fontWeight: '500'
    }
    ,
    flex_two: {
        width: '60vw',
        height: '30px',
        margin: '4px',
    }
})

export default PackageContact;
